/// @title Base64
/// @author Brecht Devos - <brecht@loopring.org>
/// @notice Provides a function for encoding some bytes in base64
library Base64 {
    string internal constant TABLE =
        "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/";

    function encode(bytes memory data) internal pure returns (string memory) {
        if (data.length == 0) return "";

        // load the table into memory
        string memory table = TABLE;

        // multiply by 4/3 rounded up
        uint256 encodedLen = 4 * ((data.length + 2) / 3);

        // add some extra buffer at the end required for the writing
        string memory result = new string(encodedLen + 32);

        assembly {
            // set the actual output length
            mstore(result, encodedLen)

            // prepare the lookup table
            let tablePtr := add(table, 1)

            // input ptr
            let dataPtr := data
            let endPtr := add(dataPtr, mload(data))

            // result ptr, jump over length
            let resultPtr := add(result, 32)

            // run over the input, 3 bytes at a time
            for {

            } lt(dataPtr, endPtr) {

            } {
                dataPtr := add(dataPtr, 3)

                // read 3 bytes
                let input := mload(dataPtr)

                // write 4 characters
                mstore(
                    resultPtr,
                    shl(248, mload(add(tablePtr, and(shr(18, input), 0x3F))))
                )
                resultPtr := add(resultPtr, 1)
                mstore(
                    resultPtr,
                    shl(248, mload(add(tablePtr, and(shr(12, input), 0x3F))))
                )
                resultPtr := add(resultPtr, 1)
                mstore(
                    resultPtr,
                    shl(248, mload(add(tablePtr, and(shr(6, input), 0x3F))))
                )
                resultPtr := add(resultPtr, 1)
                mstore(
                    resultPtr,
                    shl(248, mload(add(tablePtr, and(input, 0x3F))))
                )
                resultPtr := add(resultPtr, 1)
            }

            // padding with '='
            switch mod(mload(data), 3)
            case 1 {
                mstore(sub(resultPtr, 2), shl(240, 0x3d3d))
            }
            case 2 {
                mstore(sub(resultPtr, 1), shl(248, 0x3d))
            }
        }

        return result;
    }
}

contract TheGuySoftV2 is ERC721URIStorage, Ownable, ReentrancyGuard {
    using SafeMath for uint256;
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIdCounter;

    mapping(uint256 => bool) private sticky;

    struct Payee {
        address wallet;
        string role;
        uint256 percentage;
    }

    Payee[] private payees;

    modifier onlyUser(address _sender) {
        //require(tx.origin == msg.sender, "contracts are not allowed");
        uint32 size;
        assembly {
            size := extcodesize(_sender)
        }
        require(size == 0, "contracts are not allowed");
        _;
    }

    uint256 public PRICE_MINT_CUSTOM = 0.02 ether;
    uint256 public PRICE_MINT_CUSTOM_STICKY = 0.03 ether;
    uint256 public PRICE_BURN = 0.03 ether;

    // mainnet
    //IERC721 internal BLITMAP_CONTRACT = IERC721(0x8d04a8c79cEB0889Bdd12acdF3Fa9D207eD3Ff63);

    // test
    IERC721 internal BLITMAP_CONTRACT = IERC721(0x1b4C2BA0c7Ee2AAF7710A11c3a2113C24624852B);

    function withdrawToPayees(uint256 _amount) internal onlyUser(msg.sender) {
        for (uint256 i = 0; i < payees.length; i++) {
            Payee memory payee = payees[i];
            address payable to = payable(payee.wallet);
            to.transfer(_amount.mul(payee.percentage).div(100));
        }
    }

    constructor() ERC721("The Soft Bid Guy", "BIDGUYV2") onlyOwner {
        payees.push(
            Payee(0x3B99E794378bD057F3AD7aEA9206fB6C01f3Ee60, "artist", 17)
        );

        payees.push(
            Payee(0x575CBC1D88c266B18f1BB221C1a1a79A55A3d3BE, "developer", 17)
        );

        payees.push(
            Payee(0xBF7288346588897afdae38288fff58d2e27dd235, "developer", 17)
        );

        payees.push(Payee(BLITMAP_CONTRACT.ownerOf(346), "owner of #346", 49));
    }

    function mint(
        address to,
        string memory _description,
        string memory _imageText,
        bool _sticky
    ) external payable nonReentrant onlyOwner {
        if (_sticky == false) {
            require(msg.value >= PRICE_MINT_CUSTOM, "not enough ethers");
        } else {
            require(msg.value >= PRICE_MINT_CUSTOM_STICKY, "not enough ethers");
        }

        withdrawToPayees(msg.value);
        _safeMint(to, _tokenIdCounter.current());
        _setTokenURI(
            _tokenIdCounter.current(),
            generateMetadata(
                "The Soft Bid Guy",
                _description,
                _imageText,
                _sticky
            )
        );
        sticky[_tokenIdCounter.current()] = _sticky;
        _tokenIdCounter.increment();
    }

    function approve(address to, uint256 tokenId) public override {
        require(sticky[tokenId] != true, "disabled");
        super.approve(to, tokenId);
    }

    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public virtual override {
        require(sticky[tokenId] != true, "disabled");
        super.safeTransferFrom(from, to, tokenId, "");
    }

    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId,
        bytes memory _data
    ) public virtual override {
        require(sticky[tokenId] != true, "disabled");
        super._safeTransfer(from, to, tokenId, _data);
    }

    /*
    // test pls
    function setApprovalForAll(address operator, bool approved) public virtual override {
        require(sticky[tokenId] != true, "disabled");
        super.setApprovalForAll(operator, approved);
    }
    */

    function transferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public virtual override {
        require(sticky[tokenId] != true, "disabled");
        super.transferFrom(from, to, tokenId);
    }

    function burn(uint256 tokenId) external payable nonReentrant {
        if (sticky[tokenId] == true) {
            require(msg.value >= PRICE_BURN, "not enough ethers ");
            withdrawToPayees(msg.value);
        }
        super._burn(tokenId);
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721URIStorage)
        returns (string memory)
    {
        return super.tokenURI(tokenId);
    }

    function svgHeader() internal pure returns (string memory) {
        return
            "<svg xmlns='http://www.w3.org/2000/svg' baseProfile='tiny-ps' viewBox='0 0 320 320' width='350' height='350'><style><![CDATA[text{letter-spacing:-0.8px}.B{font-family:press_start_2pregular}.C{word-spacing:-4px}]]></style><path fill='#d57eb1' d='M320 320H0V0h320v320z'/><path fill='#e5acb3' d='M320 290h-30v-10h-20v-10h-30v-10h-10v-10h-30v-10h-40v-10h-30v-10h-20v-10H80v-10H60v-10H50v-10H30v-20H20v-20H10v-20h10V90h10V80h10V70h20V60h20V50h110v10h40v10h10v10h20v10h20v10h10v10h20v10h10v170z'/><path fill='#ba7393' d='M320 110h-10v-10h-10V90h-20V80h-20V70h-20V60h-10V50h-30V40H80v10H50v10H40v10H20v10H10v30H0v40h10v20h10v10h10v10h10v10h10v10h20v10h30v10h30v10h20v10h40v10h30v10h20v10h20v10h30v10h20v10h10v-20h-29l-1-10h-20v-10h-29l-1-10h-10v-10h-30v-10h-40v-10h-29l-1-10h-20v-10H80v-10H60v-10H50v-10H31l-1-20H20v-20H10v-20h10V90h10V80h10l1-10h19V60h20l1-10h109v10h39l1 10h9l1 10h19l1 10h19l1 10h10v10h19l1 10h10v-10zm-100 60v-20h-10v10H60v-10H50v20h10v19l1 1h139v-10H70v-10h130v9l1 1h9v-10h10zm-60-50v20h30v-20h-30zm-90 20h30v-20H70v20zm-30-40v10h70v-10h10V90h-10V70h-10v30H40zm110-30h-10v20h-10v10h10v10h110v-10H150V70z'/><path fill='#e9e9e9' d='M60 140v10h40v-10H60zm0-40V90h40v10H60zm60-10h10v10h10v10h-30v-10h10V90zm0-20v10h10V70h-10zm30 30V90h50v10h-50zm10 40v10h40v-10h-40zm-50 50v10h30v-10h-30zm90-10v10h10v-10h-10zm20 0h-9l-1-1v-9h10v10z'/><text fill='#fff' x='14' y='30' font-size='12' class='B C'>";
    }

    function svgFooter() internal pure returns (string memory) {
        return
            "</text><text fill='#fff' x='14' y='260' font-size='12' class='B C'>...you have been visited by</text><text fill='#fff' x='14' y='290' font-size='12' class='B C'>The Guy Soft, King of cucks</text><defs ><style>@font-face{font-family:'press_start_2pregular';src:url(data:application/font-woff2;charset=utf-8;base64,) format('woff'); font-weight:normal;font-style:normal;}</style></defs></svg>";
    }

    function generateSVG(string memory _title)
        internal
        pure
        returns (string memory)
    {
        return
            string(
                Base64.encode(
                    bytes(abi.encodePacked(svgHeader(), _title, svgFooter()))
                )
            );
    }

    function generateMetadata(
        string memory _name,
        string memory _description,
        string memory _title,
        bool _sticky
    ) internal pure returns (string memory) {
        string memory description2;

        if (_sticky == true) {
            description2 = ' | Click to burn: https://yourbidsux.wtf/ | Original Blitmap ID: #346",';
        } else {
            description2 = ' | https://yourbidsux.wtf/ | Original Blitmap ID: #346",';
        }

        return
            string(
                abi.encodePacked(
                    "data:application/json;base64,",
                    Base64.encode(
                        bytes(
                            abi.encodePacked(
                                '{"name": "',
                                _name,
                                '",',
                                '"description": "',
                                _description,
                                description2,
                                '"image": "data:image/svg+xml;base64,',
                                generateSVG(_title),
                                '"}'
                            )
                        )
                    ),
                    "#"
                )
            );
    }
}

